import React from 'react';
import './Hero.css';

function Hero() {
  return (
    <div className="hero">
      <div className="overlay">
        <h1>Breaking News</h1>
        <p>Stay updated with the latest headlines and top stories.</p>
        <button className="news-btn">Read Now</button>
      </div>
    </div>
  );
}

export default Hero;
